import React from "react";
import { Route, Redirect } from 'react-router-dom';
import { Consumer } from './Context';

const PrivateRoute = ({ component: Component, ...rest }) => {

  const checkUser = (props) => {
    if(props.context.authenticatedUser[ "User ID" ] === props.userId || props.userId === null) {
    return (
    <Consumer>
      <Component {...props} />
    </Consumer>
    )

  }else {
    return (<Redirect to={{
      pathname: '/forbidden',
      state: { from: props.location },
    }} />)
  }}



  return (
    <Consumer>
      { context => (
        <Route
          {...rest}
          render={props => context.authenticatedUser ? checkUser 
              : (
                <Redirect to={{
                  pathname: '/signin',
                  state: { from: props.location },
                }} />
              )
          }
        />
      )}
    </Consumer>
  );
}

export default PrivateRoute;
